script: |
  super -f text -I q5055.spq | sort > q5055.out

inputs:
  - name: q5055.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE NOT + col2 NOT IN ( + col2, - col1 + col2, col0, + 74 + - col0 * + 97 * col2 * + 21 );
  - name: tab1

outputs:
  - name: q5055.out
    data: |
      51	14	96
      85	5	59
      91	47	68
